import { useDispatch, useSelector } from 'react-redux';
import { handleFetch } from '../../asyncActions/index';
import { displayUsers } from "../../store/actions/index";
import { useState, useEffect } from 'react';

function UserList () {
    const dispatch = useDispatch();
    const users = useSelector(state => state.users.users);
    const url = 'https://jsonplaceholder.typicode.com/users';
    // const [urlType, setUrlType] = useState(url);

    useEffect(() => {
        dispatch(handleFetch(url, displayUsers));
    }, [])

    // function displayUserList() {
    //     setUrlType('https://jsonplaceholder.typicode.com/users');
    // }

    // displayUserList();

    // function displayUserList() {
    //     dispatch(handleFetch(url, displayUsers));
    // }

    // useState(dispatch(handleFetch(url, displayUsers)));

    // function displayUserList () {
    //     useEffect(() => {
    //         dispatch(handleFetch(url, displayUsers));
    //     }, [])
    // }

    // displayUserList();

    return (
        <div className='content'>
            {/* {displayUserList()} */}
            {users.length > 0 ?
                <table>
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Username</th>
                        </tr>
                    </thead>
                    {users.map(user =>
                    <tbody>
                        <tr>
                            <td>{user.name}</td>
                            <td>{user.username}</td>   
                        </tr>    
                    </tbody>   
                    )}
                </table>
            :
                <div className='error'>
                    <h3>No clients</h3>
                </div>
            }
        </div>
    )
}

export default UserList;
